import { Box } from '@mui/material';
import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
<Box width="400">
  <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="/exercise/:id" element={<ExerciseDetails/>}/>

  </Routes>
</Box>
  );
}

export default App;
